position:absolute;
top:0;
left:0;
width:80%;
height: 100vh;
background: #000;
`;

export const DropUp =styled.div`
display:flex;
justify-content: space-between;
align-items:center;
`;


const StyledImg = styled(Image)`
`;

export const CardImg = ({ src }) => {
    return (
          <StyledImg src={src} width={600} height={713}>
                
          </StyledImg>
    );
 };
